import styled from 'styled-components'

const Container = styled.div`
    display: flex;
    flex-direction: column;
    height: 100%;
    flex: 3;
    background: #f6f7f8;
`
const ChatHeader = styled.div `
    display: flex;
    flex-direction: row;
    background: #ededed;
    padding: 10px;
    align-items: center;
`
const ProfileImg = styled.img`
    height: 32px;
    width: 32px;
    border-radius: 50%;
`;

const ChatComponent = () => {
    return(
        <Container>
            <ChatHeader>
                <ProfileImg src='/Profile/Akhil.jpeg'/> Akhil CH
            </ChatHeader>
        </Container>
    )
}

export default ChatComponent;
